import ExpenseItem from "./components/ExpenseItem";

function App() {
  let expensesList = [
    {
      date: new Date(2021, 10, 15),
      title: "Car Auusrance",
      amount: 297.68,
    },
    {
      date: new Date(2021, 10, 15),
      title: "Car Auusrance",
      amount: 297.68,
    },
    {
      date: new Date(2021, 10, 15),
      title: "Car Auusrance",
      amount: 297.68,
    },
    {
      date: new Date(2021, 10, 15),
      title: "Car Auusrance",
      amount: 297.68,
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expensesList[0].title}
        amount={expensesList[0].amount}
        date={expensesList[0].date.toUTCString()}
      ></ExpenseItem>
      <ExpenseItem
        title={expensesList[1].title}
        amount={expensesList[1].amount}
        date={expensesList[1].date.toUTCString()}
      ></ExpenseItem>
      <ExpenseItem
        title={expensesList[2].title}
        amount={expensesList[2].amount}
        date={expensesList[2].date.toUTCString()}
      ></ExpenseItem>
    </div>
  );
}

export default App;
